import React from 'react';
import './About copy.css';
import SlideShow from './Slideshow';
import AnimatedNumber from 'react-animated-number';

function About() {
  return (
<div class="about2-container" id="about">
      <div class="section2">
        <div class="text2">
          <AnimatedNumber
          value={0}
          style={
            {
              fontSize:30
            }
          }
        />
          <h1>
             Singapore <br />
             Students' <br />
           <span className="w"> Association </span>
         </h1>
        </div>
         <div className='ssa-p'>
          <p>The UBC Singapore </p>
          </div>
        </div>
      <div className='ssa-gallery2'>
          <img src='images/msn2022.jpg' alt='msn2022' className='test' />
      </div>
</div>
  );
}

export default About;
